import axios from 'axios';
import * as Auth from '@/constants/Endpoints';

export default {
    getUser: () => axios({ ...Auth.FETCH_USER }).then(res => res.data),
    updateUser: data => axios({ ...Auth.FETCH_USER, data }).then(res => res.data),
    addPNUser: data =>axios({...Auth.AddPNUser, data}).then(res=>res.data),
};


